import React from 'react';
import logo from './logo.svg';
import './App.css';
import { AppBar, Toolbar } from '@material-ui/core';
import ProblemCard from "./ProblemLayout/ProblemCard";

const cards = [1,1,1,1,1,1,1]
const ProblemCards = cards.map((number) =>
    <ProblemCard></ProblemCard>
);

function App() {

  return (

      <>
      <AppBar position="static">
          <Toolbar>Open ITS</Toolbar>
      </AppBar>
      <ProblemCards></ProblemCards>
      </>
  );
}

export default App;
